import React from 'react';

function Contact() {
  return (
    <>
      <h2>Contact</h2>
      <ul className="contact">
        <div className="email">
          <li>Email</li>
          <p>FrancesLHughes@hotmail.com</p>
        </div>
        <div className="phone">
          <li>Phone</li>
          <p>021 061 4757</p>
        </div>
      </ul>
    </>
  );
}

export default Contact;
